import React from 'react'
import { ContextGlobal } from "../Components/utils/global.context";

const Footer = () => {

  useContext(ContextGlobal)
  return (
    <footer>
        <p>Powered by</p>
        <img src="./images/DH.png" alt='DH-logo' />
    </footer>
  )
}

export default Footer
